We begin by expanding the product: \begin{align*}
(n + 2)(n + 4)(n + 6) &= (n^2 + 6n + 8)(n + 6) \\
&= n^3 + 6n^2 + 8n + 6n^2 + 36n + 48 \\
&= n^3 + 12n^2 + 44n + 48.
\end{align*}We then use the fact that $n \equiv 2 \pmod{7}$ to replace $n$ with 2: \begin{align*}
n^3 + 12n^2 + 44n + 48 &\equiv 2^3 + 12 \cdot 2^2 + 44 \cdot 2 + 48 \\
&= 8 + 48 + 88 + 48 \\
&= 200 \\
&\equiv \boxed{3} \pmod{7}.
\end{align*}

