De radicaal geconjugeerde van $5+\sqrt{3}$ is $5-\sqrt{3}$. De som en het product van de twee getallen is
\begin{align*}
(5+\sqrt{3})+(5-\sqrt{3})&=10,\\
(5+\sqrt{3})(5-\sqrt{3})&=5^2-\sqrt{3}^2=25-3=\boxed{22}.
\end{align*}

Onderstel de prijzen van de potloden $p$ en de jumbo-gum $j$. Dan is er een stelsel van twee vergelijkingen met twee onbekenden:
\begin{align*}
2p+j&=124\\
5p+j&=182
\end{align*}
Subtracter de eerste van de vergelijkingen van de tweede:
\begin{align*}
(5p+j)-(2p+j)&=182-124\\
3p&=58\\
p&=\frac{58}{3}
\end{align*}
De prijs van een potlood is $\frac{58}{3}$ centen, of $19\frac{1}{3}$ centen. De opgave zegt dat de prijzen oncomen, dus de prijs van een potlood is $\boxed{19\frac{1}{3}}$ centen.

